import React from 'react';

const Detail = props => {
  return <div className="task-wrapper" id={props.task.id} >
    <h2>Nombre de tarea:</h2>
    <p>{props.task.name}</p>
    <button type="submit">Ver detalle</button>
  </div>
}

export default Detail;
